INSERT INTO `rulefile` VALUES (1,1,1,'donudgeapi','import java.util.HashMap;\r\nimport org.json.JSONObject;\r\nimport java.util.Date; \r\nimport java.text.SimpleDateFormat; \r\nimport com.satimetry.nudge.Output;\r\n\r\nglobal java.util.HashMap output;\r\nglobal SimpleDateFormat inSDF;\r\nglobal SimpleDateFormat outSDF;\r\n\r\nfunction void print(String txt) {\r\n   System.out.println(txt);\r\n}\r\n\r\n// Declare inside drl so we can manipulate objects naturally\r\ndeclare Participant\r\n  @role( fact )\r\n  id : String @key\r\n  dayofweek : String\r\nend\r\n\r\n// Declare inside drl so we can manipulate objects naturally\r\ndeclare Activity\r\n  @role( event )\r\n  @timestamp ( stepDate )\r\n  id : String @key\r\n  stepDate : Date @key\r\n  stepCount : Integer\r\nend\r\n\r\ndeclare UserRule\r\n  @role( fact )\r\n  id : String @key\r\n  ruleName : String @key\r\nend\r\n\r\nrule \"rulePrintJSON\"\r\n   salience 2000\r\n   when\r\n      $input : JSONObject() from entry-point DEFAULT\r\n   then\r\n      System.out.println($input.toString());\r\n      System.out.println($input.get(\"obsdate\"));\r\nend\r\n\r\nrule \"ruleInsertActivity\"\r\n  salience 2000\r\n  when\r\n    $input : JSONObject() from entry-point DEFAULT \r\n  then\r\n    inSDF = new SimpleDateFormat(\"yyyy-M-d\");\r\n    Date date = inSDF.parse( $input.get(\"obsdate\").toString() );\r\n    Activity activity = new Activity($input.get(\"username\").toString(), date);\r\n    activity.setStepCount( Integer.parseInt($input.get(\"obsvalue\").toString()) );\r\n    insert(activity);\r\n    print(drools.getRule().getName() + \"->\" + activity.getId() + \"-\" + activity.getStepDate() + \"-\" + activity.getStepCount() );\r\nend\r\n\r\nrule \"ruleInsertParticipant\"\r\n  salience 1000\r\n  when\r\n    $input : JSONObject() from entry-point DEFAULT \r\n    not Participant( id == $input.get(\"username\") )\r\n  then\r\n    Date today = new Date();\r\n    String dayofweek = new SimpleDateFormat(\"EE\").format(today);\r\n    Participant $participant = new Participant( $input.get(\"username\").toString() );\r\n    $participant.setDayofweek(dayofweek);\r\n    insert( $participant );\r\n    print(drools.getRule().getName() + \"->\" + $participant.getId() );\r\nend\r\n\r\nrule \"ruleHighStepCount\"\r\n  salience -1000\r\n  no-loop true\r\n  when\r\n     $participant : Participant()\r\n     $stepCountTotal : Number( intValue > 0) from accumulate(\r\n      Activity( $stepCount : stepCount >= 10000, $participant.id == id ) over window:time( 30d ),\r\n          count( $stepCount ) )\r\n  then\r\n      Date today = new Date(); \r\n      JSONObject joutput = new JSONObject();\r\n      joutput.put(\"id\", $participant.getId());\r\n      joutput.put(\"rulename\", drools.getRule().getName());\r\n      joutput.put(\"ruledate\", today); \r\n      joutput.put(\"rulemsg\", \"Nudge says that you exceeded 10,000 steps \" + $stepCountTotal + \" times in the past 30 days\");\r\n      joutput.put(\"ruledata\", $stepCountTotal);\r\n      Output $output = new Output(joutput.toString());\r\n      insert($output);\r\n      print(drools.getRule().getName() + \"->\" + $stepCountTotal);\r\nend\r\n\r\nrule \"ruleAverageStepCount\"\r\n  salience -1000\r\n  no-loop true\r\n  when\r\n     $participant : Participant()\r\n     $stepCountAverage : Number( intValue > 0) from accumulate(\r\n      Activity( $stepCount : stepCount > 0, $participant.id == id ) over window:time( 30d ),\r\n          average( $stepCount ) )\r\n  then\r\n      Date today = new Date(); \r\n      JSONObject joutput = new JSONObject();\r\n      joutput.put(\"id\", $participant.getId());\r\n      joutput.put(\"rulename\", drools.getRule().getName());\r\n      joutput.put(\"ruledate\", today);      \r\n      joutput.put(\"rulemsg\", \"Nudge says that you averaged \" + \r\n         String.format(\"%.2f\", $stepCountAverage) + \r\n         \" steps per day over the last 30 days\");\r\n      joutput.put(\"ruledata\", $stepCountAverage);\r\n      Output $output = new Output(joutput.toString());\r\n      insert($output);\r\n      print(drools.getRule().getName() + \"--->\" + $stepCountAverage + \"-\" + joutput.get(\"ruledate\") );\r\nend\r\n\r\n\r\n            '),(2,1,7,'activity','import java.util.HashMap;\nimport org.json.JSONObject;\nimport java.util.Date; \nimport java.text.SimpleDateFormat; \nimport com.satimetry.nudge.Output;\n\nglobal java.util.HashMap output;\nglobal SimpleDateFormat inSDF;\nglobal SimpleDateFormat outSDF;\n\nfunction void print(String txt) {\n   System.out.println(txt);\n}\n\n// Declare inside drl so we can manipulate objects naturally\ndeclare Participant\n  @role( fact )\n  id : String @key\n  dayofweek : String\nend\n\n// Declare inside drl so we can manipulate objects naturally\ndeclare Activity\n  @role( event )\n  @timestamp ( stepDate )\n  id : String @key\n  stepDate : Date @key\n  stepCount : Integer\nend\n\ndeclare UserRule\n  @role( fact )\n  id : String @key\n  ruleName : String @key\nend\n\nrule \"rulePrintJSON\"\n   salience 2000\n   when\n      $input : JSONObject() from entry-point DEFAULT\n   then\n      System.out.println($input.toString());\n      System.out.println($input.get(\"obsdate\"));\nend\n\nrule \"ruleInsertActivity\"\n  salience 2000\n  when\n    $input : JSONObject() from entry-point DEFAULT \n  then\n    inSDF = new SimpleDateFormat(\"yyyy-M-d\");\n    Date date = inSDF.parse( $input.get(\"obsdate\").toString() );\n    Activity activity = new Activity($input.get(\"username\").toString(), date);\n    activity.setStepCount( Integer.parseInt($input.get(\"obsvalue\").toString()) );\n    insert(activity);\n    print(drools.getRule().getName() + \"->\" + activity.getId() + \"-\" + activity.getStepDate() + \"-\" + activity.getStepCount() );\nend\n\nrule \"ruleInsertParticipant\"\n  salience 1000\n  when\n    $input : JSONObject() from entry-point DEFAULT \n    not Participant( id == $input.get(\"username\").toString() )\n  then\n    Date today = new Date();\n    String dayofweek = new SimpleDateFormat(\"EE\").format(today);\n    Participant $participant = new Participant( $input.get(\"username\").toString() );\n    $participant.setDayofweek(dayofweek);\n    insert( $participant );\n    print(drools.getRule().getName() + \"->\" + $participant.getId() );\nend\n\nrule \"ruleHighStepCount\"\n  salience -1000\n  no-loop true\n  when\n     $participant : Participant()\n     $stepCountTotal : Number( intValue > 0) from accumulate(\n      Activity( $stepCount : stepCount >= 10000, $participant.id == id ) over window:time( 30d ),\n          count( $stepCount ) )\n  then\n      Date today = new Date(); \n      java.util.Date date = new Date();\n      SimpleDateFormat sdf = new SimpleDateFormat(\"yyyy-MM-dd\");\n      String datef = sdf.format( date );\n\n      JSONObject joutput = new JSONObject();\n      joutput.put(\"id\", $participant.getId());\n      joutput.put(\"rulename\", drools.getRule().getName());\n      joutput.put(\"ruledate\", datef); \n      joutput.put(\"rulemsg\", \"Nudge says that you exceeded 10,000 steps \" + $stepCountTotal + \" times in the past 30 days\");\n      joutput.put(\"ruledata\", $stepCountTotal);\n      Output $output = new Output(joutput.toString());\n      insert($output);\n      print(drools.getRule().getName() + \"->\" + $stepCountTotal);\nend\n\nrule \"ruleAverageStepCount\"\n  salience -1000\n  no-loop true\n  when\n     $participant : Participant()\n     $stepCountAverage : Number( intValue > 0) from accumulate(\n      Activity( $stepCount : stepCount > 0, $participant.id == id ) over window:time( 7d ),\n          average( $stepCount ) )\n  then\n      Date today = new Date(); \n      java.util.Date date = new Date();\n      SimpleDateFormat sdf = new SimpleDateFormat(\"yyyy-MM-dd\");\n      String datef = sdf.format( date );\n\n      JSONObject joutput = new JSONObject();\n      joutput.put(\"id\", $participant.getId());\n      joutput.put(\"rulename\", drools.getRule().getName());\n      joutput.put(\"ruledate\", datef);      \n      joutput.put(\"rulemsg\", \"Nudge says that you averaged \" + \n         String.format(\"%.2f\", $stepCountAverage) + \n         \" steps per day over the last 7 days\");\n      joutput.put(\"ruledata\", $stepCountAverage);\n      Output $output = new Output(joutput.toString());\n      insert($output);\n      print(drools.getRule().getName() + \"--->\" + $stepCountAverage + \"-\" + joutput.get(\"ruledate\") );\nend\n'),(3,1,7,'gas','import java.util.HashMap;\nimport org.json.JSONObject;\nimport java.util.Date; \nimport java.text.SimpleDateFormat; \nimport com.satimetry.nudge.Output;\n\nglobal java.util.HashMap output;\nglobal SimpleDateFormat inSDF;\nglobal SimpleDateFormat outSDF;\n// Note that you cannot use variables inside sliding window clause\nglobal String window;\n\nfunction void print(String txt) {\n   System.out.println(txt);\n}\n\n// Declare inside drl so we can manipulate objects naturally\ndeclare Participant\n  @role( fact )\n  id : String @key\n  gastype : String\n  dayofweek : String\nend\n\n// Declare inside drl so we can manipulate objects naturally\ndeclare Observation\n  @role( event )\n  @timestamp ( obsdate )\n  id : String @key\n  obsdate : Date @key\n  obsvalue : Integer\nend\n\nrule \"setGlobalVariables\"\n  salience 10000\n  when\n    eval(true)\n  then\n    window = \"60d\";\n    print(\"window-->\" + window);\nend\n\nrule \"ruleInsertObservation\"\n  salience 2000\n  when\n    $input : JSONObject() from entry-point DEFAULT \n  then\n    inSDF = new SimpleDateFormat(\"yyyy-M-d\");\n    Date date = inSDF.parse( $input.get(\"obsdate\").toString() );\n    Observation obs = new Observation($input.get(\"username\").toString(), date);\n    obs.setObsvalue( Integer.parseInt($input.get(\"obsvalue\").toString()) );\n    insert(obs);\n    print(drools.getRule().getName() + \"->\" + obs.getId() + \"-\" + obs.getObsdate() + \"-\" + obs.getObsvalue() );\nend\n\nrule \"ruleInsertParticipant\"\n  salience 1000\n  when\n    $input : JSONObject() from entry-point DEFAULT \n    not Participant( id == $input.get(\"username\").toString() )\n  then\n    Date today = new Date();\n    String dayofweek = new SimpleDateFormat(\"EE\").format(today);\n    Participant $participant = new Participant( $input.get(\"username\").toString() );\n    $participant.setGastype( $input.get(\"obsname\").toString() );\n    $participant.setDayofweek(dayofweek);\n    insert( $participant );\n    print(drools.getRule().getName() + \"->\" + $participant.getId() + \"-\" + $participant.getGastype() );\nend\n\nrule \"ruleBestExpectedCount\"\n  salience -100\n  no-loop true\n  when\n    $participant : Participant( dayofweek != \"Sun\" )\n    $obsCountTotal : Number( intValue > 0) from accumulate(\n      Observation( $obsCount : obsvalue == 2, $participant.id == id ) over window:time( 60d ),\n      count( $obsCount ) )\n  then\n    Date today = new Date();\n\n    java.util.Date date = new Date();\n    SimpleDateFormat sdf = new SimpleDateFormat(\"yyyy-MM-dd\");\n    String datef = sdf.format( date );\n\n    JSONObject joutput = new JSONObject();\n    joutput.put(\"id\", $participant.getId());\n    joutput.put(\"rulename\", drools.getRule().getName());\n    joutput.put(\"ruledate\", datef);\n    joutput.put(\"rulemsg\", \"Nudge says that for goal \" + $participant.getGastype() + \" you attained your best expected outcome \" + $obsCountTotal + \" times in the past 60 days\");\n		joutput.put(\"ruledata\", \"http://www.satimetry.com/msg.php\");\n    Output $output = new Output(joutput.toString());\n    insert($output);\n   	print(drools.getRule().getName() + \"->\" + $participant.getId() + \" - \" + $participant.getDayofweek() );\nend\n\nrule \"ruleExpectedCount\"\n  salience -100\n  no-loop true\n  when\n    $participant : Participant( dayofweek == \"Sun\" )\n    $obsCountTotal : Number( intValue > 0) from accumulate(\n      Observation( $obsCount : obsvalue >= 0, $participant.id == id ) over window:time( 60d ),\n      count( $obsCount ) )\n  then\n    Date today = new Date();\n\n    java.util.Date date = new Date();\n    SimpleDateFormat sdf = new SimpleDateFormat(\"yyyy-MM-dd\");\n    String datef = sdf.format( date );\n\n    JSONObject joutput = new JSONObject();\n    joutput.put(\"id\", $participant.getId());\n    joutput.put(\"rulename\", drools.getRule().getName());\n    joutput.put(\"ruledate\", datef);\n//    joutput.put(\"rulemsg\", \"Nudge says that for \" + $participant.getGastype() + \" you attained your expected outcome or better \" + $obsCountTotal + \" times in the past 60 days.\");\n    joutput.put(\"rulemsg\", \"Nudge says for \" + $participant.getGastype() + \" you attained your expected outcome or better\" + $obsCountTotal + \" times in past 60 days\");\n  	joutput.put(\"ruledata\", \"http://www.satimetry.com/msg.php\");\n    Output $output = new Output(joutput.toString());\n    insert($output);\n   	print(drools.getRule().getName() + \"->\" + $participant.getId() + \" - \" + $participant.getDayofweek() );\nend\n\nrule \"ruleDailySurveyReminder\"\n  salience -300\n  when\n    $participant : Participant()\n    $obsCountTotal : Number( intValue > 0) from accumulate(\n      Observation( $obsCount : obsvalue > -10000000, $participant.id == id ) over window:time( 5d ),\n      count( $obsCount ) )\n  then\n    Date today = new Date();\n\n    java.util.Date date = new Date();\n    SimpleDateFormat sdf = new SimpleDateFormat(\"yyyy-MM-dd\");\n    String datef = sdf.format( date );\n\n    JSONObject joutput = new JSONObject();\n    joutput.put(\"id\", $participant.getId());\n    joutput.put(\"rulename\", drools.getRule().getName());\n    joutput.put(\"ruledate\", datef);\n//    joutput.put(\"rulemsg\", \n//      \"Reminder to record your goal \" + $participant.getGastype() + \" attainment at http://www.satimetry.com/goal.php?ruletype=gaslow\" +\n//      \" You have completed \" +  $obsCountTotal + \" self-reports over the past 5 days.\");\n    joutput.put(\"rulemsg\", \n      \"Reminder to record goal \" + $participant.getGastype() + \" attainment at http://www.satimetry.com/goal.php?ruletype=gaslow\");\n    joutput.put(\"ruledata\", \"http://www.satimetry.com/goal.php?ruletype=gaslow\");\n    Output $output = new Output(joutput.toString());\n    insert($output);\n    print(drools.getRule().getName() + \"->\" + $participant.getId());\nend\n\n');
